import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import Switch as well if you plan to use it
import './index.css';
import './App.css';
// import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home';
import About from './components/About';
import Artists from './components/Artists';
import Booking from './components/Booking';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <div className="font-custom">Have Fun Tattoo</div>
        </p>
      </header>
      <Router>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/artists">
            <Artists />
          </Route>
          <Route path="/booking">
            <Booking />
          </Route>
        </Switch>
      </Router>
      <Footer />
    </div>
  );
}

export default App;
